hcl:
terraform {
  required_providers {
    jamfpro = {
      source  = "deploymenttheory/jamfpro"
      version = "~> 0.19.0"
    }
  }
}

provider "jamfpro" {
  # Configuration parameters
}

# Jamf App Catalog: Microsoft Word 365
resource "jamfpro_app_installer" "microsoft_word_365" {
  name            = "Microsoft Word 365"
  enabled         = true
  deployment_type = "SELF_SERVICE"
  update_behavior = "AUTOMATIC"
  category_id     = "-1"
  site_id         = "-1"
  smart_group_id  = "1"
}
